            <div className="blog">
       <div className="container">
           <div className="col-sm-12">
<h4>RECENT NEWS</h4>
<h1>Check Our Blog <span>Posts</span></h1>
<img src={bar}/>
           </div>
       </div>
            </div>
        )
    }
}
export default Blog
